var customSettings = {};

const roundNearest = (value, nearest) => Math.round(value / nearest) * nearest;
const roundNearestPow = (value, power) => Math.pow(power,Math.floor(Math.log(value)/Math.log(power)))  ;

function customize() {

// make size a power of two
settings["radius"]  = roundNearestPow(settings["radius"], 2.0);

let gridSize = (settings["radius"] * 2.0);

// pad 1px
settings["radius"]  = settings["radius"]  * 0.5;

var flipx = 1;
var flipy = 1;

if (Math.random() > 0.5) {
flipx = -1;
}

if (Math.random() > 0.5) {
flipy = -1;
}

// align each dab to the grid
position[0] = roundNearest(position[0] + Math.random() * 512 * flipx * inputs["controllerAx"] + settings["radius"], gridSize) - settings["radius"];
position[1] = roundNearest(position[1] + Math.random() * 512 * flipy *  inputs["controllerAx"] + settings["radius"], gridSize) - settings["radius"];




// randomize color and/or lighten/darken using controller C
let i = 0;
while (i < color.length) {
  let k = 0;
  while (k < color[i].length) {

    if ( inputs["controllerCy"] > 0.5 ) {
      color[i][k] *= 1.0 - inputs["controllerCy"] ;
    } else {
      color[i][k] -= (0.5 - inputs["controllerCy"] ) / 0.5 * 12 * settings["opacity"];
    }

    color[i][k] *= 1.0 - (Math.random() * inputs["controllerCx"]);
    k++;
  }
  i++;
}

customSettings = {

controllerAx: {
    "Scatter": inputs["controllerAx"] 
  },

  controllerCy: {
    "Brightness": inputs["controllerCy"] 
  },
  controllerCx: {
    "ColorRandomize": inputs["controllerCx"] 
  }
}

}
